import { Route, Routes } from "react-router-dom";
import Signup from "./pages/Auth/Signup";
import Login from "./pages/Auth/Login";
import Layout from "./components/layout/Layout";
function App() {
  return (

    <Layout>
          <Login />

      <Routes>
        <Route path="/login" exact>
          <Login />
        </Route>
        <Route path="/signup"> 
          <Signup />
        </Route>
      </Routes>
    </Layout>
  );
}

export default App;
